<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <meta name="ad.size" content="width=300,height=250">
  <style>

    body {
      margin: 0;
      padding: 0;
    }
    .ad-container, svg{
      width: 300px;
      height: 600px;
    }
    
    .ad-container {
      
      background-image: linear-gradient(
      135deg,
      rgb(250, 230, 117),
      rgb(243, 205, 0)
      );
      background-size: auto 100%;
      overflow: hidden;
      position: relative;
    }
    
    
    
    /* PROGRESS BAR */
    
    .progress-bar-container {
      width: 100%;
      height: 1px;
      border-radius: 3px;
      overflow: hidden;
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
    }
    
    .progress-bar {
      height: 100%;
      width: 0%;
      background: rgb(37, 31, 24);
      border-radius: 3px;
      animation: progressBarAnim 15s linear forwards;
    }
    
    @keyframes progressBarAnim {
      from {
        width: 0%;
      }
      to {
        width: 100%;
      }
    }
    
    
    /* ANIMATION */
    path,
    rect, polygon {
      opacity: 0;
      transform: translateY(20px);
    }
    
    /* S1 */
    #sponsors * {
      animation: fadeInMove 400ms forwards 0ms;
    }
    #artwork * {
      animation: fadeInMove 600ms forwards 200ms, bounceIn 700ms cubic-bezier(.68,-0.55,.27,1.55) 800ms 1 forwards;
    }

    #desc {
      animation: fadeInMove 800ms forwards 400ms;
    }
    
    #register,
    #btn {
      animation: fadeInMove 1000ms forwards 600ms;
    }

    #logo, #date {
      animation: fadeInMove 1200ms forwards 800ms;
    }
    
    @keyframes fadeInMove {
      to {
      opacity: 1;
      transform: translateY(0);
      }
    }
    
    @keyframes fadeOut {
      to {
        opacity: 0;
      }
    }
    
  </style>
</head>
<body>
  <a href="javascript:window.open(window.clickTag)" target="_blank">
